import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { Router } from '@angular/router';
import { MeetingService } from '../../services/meeting.service';
import { UserService } from '../../services/user.service';
import { AuthService } from '../../services/auth.service';
import { MeetingRequest } from '../../models/meeting.model';
import { User } from '../../models/user.model';

@Component({
  selector: 'app-meeting-form',
  standalone: true,
  imports: [CommonModule, FormsModule],
  templateUrl: './meeting-form.component.html',
  styleUrls: ['./meeting-form.component.css']
})
export class MeetingFormComponent implements OnInit {
  meeting: MeetingRequest = {
    title: '',
    description: '',
    startTime: '',
    endTime: '',
    organizerId: 0,
    participantIds: []
  };
  
  users: User[] = [];
  selectedParticipants: number[] = [];
  error: string | null = null;
  submitting = false;

  constructor(
    private meetingService: MeetingService,
    private userService: UserService,
    private authService: AuthService,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.loadUsers();
    const currentUser = this.authService.getCurrentUser();
    if (currentUser) {
      this.meeting.organizerId = currentUser.id;
    }
  }

  loadUsers(): void {
    this.userService.getAllUsers().subscribe({
      next: (data) => {
        this.users = data;
      },
      error: (err) => {
        this.error = 'Failed to load users';
        console.error('Error loading users:', err);
      }
    });
  }

  toggleParticipant(userId: number): void {
    const index = this.selectedParticipants.indexOf(userId);
    if (index > -1) {
      this.selectedParticipants.splice(index, 1);
    } else {
      this.selectedParticipants.push(userId);
    }
  }

  isParticipantSelected(userId: number): boolean {
    return this.selectedParticipants.includes(userId);
  }

  onSubmit(): void {
    this.submitting = true;
    this.error = null;
    this.meeting.participantIds = this.selectedParticipants;

    this.meetingService.createMeeting(this.meeting).subscribe({
      next: () => {
        this.submitting = false;
        this.router.navigate(['/meetings']);
      },
      error: (err) => {
        this.error = err.error?.message || 'Failed to create meeting';
        this.submitting = false;
        console.error('Error creating meeting:', err);
      }
    });
  }
}
<div class="form-container">
  <h2>Create New Meeting</h2>
  
  <div *ngIf="error" class="error">{{ error }}</div>
  
  <form (ngSubmit)="onSubmit()" #meetingForm="ngForm">
    <div class="form-group">
      <label for="title">Title *</label>
      <input 
        type="text" 
        id="title" 
        name="title"
        [(ngModel)]="meeting.title" 
        required
        class="form-control"
      />
    </div>

    <div class="form-group">
      <label for="description">Description</label>
      <textarea 
        id="description" 
        name="description"
        [(ngModel)]="meeting.description" 
        rows="3"
        class="form-control"
      ></textarea>
    </div>

    <div class="form-row">
      <div class="form-group">
        <label for="startTime">Start Time *</label>
        <input 
          type="datetime-local" 
          id="startTime" 
          name="startTime"
          [(ngModel)]="meeting.startTime" 
          required
          class="form-control"
        />
      </div>

      <div class="form-group">
        <label for="endTime">End Time *</label>
        <input 
          type="datetime-local" 
          id="endTime" 
          name="endTime"
          [(ngModel)]="meeting.endTime" 
          required
          class="form-control"
        />
      </div>
    </div>

    <div class="form-group">
      <label for="organizer">Organizer *</label>
      <select 
        id="organizer" 
        name="organizer"
        [(ngModel)]="meeting.organizerId" 
        required
        class="form-control"
      >
        <option value="0">Select organizer</option>
        <option *ngFor="let user of users" [value]="user.id">{{ user.name }}</option>
      </select>
    </div>

    <div class="form-group">
      <label>Participants</label>
      <div class="participants-list">
        <div *ngFor="let user of users" class="participant-item">
          <input 
            type="checkbox" 
            [id]="'participant-' + user.id"
            [checked]="isParticipantSelected(user.id!)"
            (change)="toggleParticipant(user.id!)"
          />
          <label [for]="'participant-' + user.id">{{ user.name }}</label>
        </div>
      </div>
    </div>

    <div class="form-actions">
      <button 
        type="submit" 
        [disabled]="!meetingForm.valid || submitting"
        class="btn-primary"
      >
        {{ submitting ? 'Creating...' : 'Create Meeting' }}
      </button>
      <button 
        type="button" 
        routerLink="/meetings"
        class="btn-secondary"
      >
        Cancel
      </button>
    </div>
  </form>
</div>
